import React from 'react';
import ProductSingle from '../components/ProductSingle.js';
import { useParams } from 'react-router-dom';

export default function Single() {
    const {id} = useParams();
    const productId = id.replace(":","")

    if(productId){
        return (
            <>
            <h1>{productId}</h1>
              <ProductSingle id={productId}/>
            </>
          )
    }else{
        console.log('g')
    }
  
}
